INSERT INTO app_content(`guid`,`sort`,`status`,`title`,`summary`,`content`,`keyword`,`oneimg`,`twoimg`,`threeimg`,`file`,`pid`,`uid`,`groupid`,`time`)VALUES('3B04F1DD66BDBAF876BB10B1A15BFF23','0','0','环保质量先行 四海家具健康品质打造快乐家','','<p>　　随着经济水平的提高，人们对生活品质的要求也越来越高。以前，人们只注重结实耐用，现在还要求设计有美感服务好，对健康质量还要有保障。那些质量差、服务 差、设计抄袭、甲醛超标、不环保的家具不仅会被曝光，还会被消费者所抛弃。而生产高品质健康家具的前提，是企业必须有高标准的生产流程。作为国内家具企业 的典范，四海家具在这方面一直走在行业的前列。<br />
